library IEEE;
use IEEE.STD_LOGIC_1164.ALL;

entity risingEdge_D_flipflop is
	Port ( D : in STD_LOGIC;
	clk : in STD_LOGIC;
	Q : out STD_LOGIC);
end risingEdge_D_flipflop;

architecture Behavioral of risingEdge_D_flipflop is

begin
	process(clk)
	begin
		if(rising_edge(clk)) then
			Q <= D;
		end if;
	end process;
end Behavioral;
